import React from 'react'

const PublishedBatteriesComponent = () => {
  return (
    <div>
      <div className="navbar bg-base-100">
        <a className="btn btn-ghost text-xl">Published batteries</a>
      </div>
    </div>
  )
}

export default PublishedBatteriesComponent
